import React, { useEffect, useState } from 'react';
import ReactDOM from 'react-dom';
import { fetchActivities, signUp } from './api'

const App = () => {
  signUp()
  fetchActivities()
  return (
    <div id="App">
      <h1>Hello, World</h1>
    </div>
  );
}

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
